import { StyleSheet, Text, View } from "react-native";
import React from "react";
import { Ionicons } from "@expo/vector-icons";
import SellerButtons from "../Component/Home/SellerButtons";

const CameraPage = () => {
  return (
    <View style={styles.bgContainer}>
      <View style={styles.headerContainer}>
        <Ionicons name="arrow-back-circle-sharp" size={24} color="black" />
        <Text style={styles.headerText}>WHAT ARE YOU OFFERING?</Text>
      </View>
      <View>
        <View style={styles.searchContainer}>
          <SellerButtons
            setSearchText={(value) => console.log(value)}
            imageSource={applogo}
            placeholder="ADD YOUR CAR"
          />
        </View>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  bgContainer: {
    flex: 1,
    backgroundColor: "#D2C6C6",
  },
  headerContainer: {
    flexDirection: "row",
    backgroundColor: "#8A7A7A",
    height: 52,
    alignItems: "center",
    shadowColor: "#000000",
    shadowOffset: {
      width: 0,
      height: 3,
    },
    shadowOpacity: 0.25,
    shadowRadius: 3.84,
    elevation: 5,
    paddingHorizontal: 10,
  },
  headerText: {
    color: "#FFFFFF",
    fontSize: 15,
    textAlign: "center",
    marginLeft: 50,
  },
  searchContainer: {
    position: "absolute",
    top: 120, // Adjust the top value to position the SearchBar below the headerImage
    width: "100%", // Set the width to occupy the full screen width
    justifyContent: "center",
    alignItems: "center",
    padding: 20,
  },
});

export default CameraPage;
